    } var canFinish = function(numCourses, prerequisites) {
    // 记录一次 traverse 递归经过的节点
    let onPath = new Array(numCourses).fill(false);
    // 记录遍历过的节点，防止走回头路
    let visited = new Array(numCourses).fill(false);
    // 记录图中是否有环
    let hasCycle = false;

    let graph = buildGraph(numCourses, prerequisites);
    // @visualize hide prerequisites

    for (let i = 0; i < numCourses; i++) {
        // 遍历图中的所有节点
        traverse(graph, i);
    }
    // 只要没有循环依赖可以完成所有课程
    return !hasCycle;

    function traverse(graph, s) {
        if (onPath[s]) {
            // 出现环
            hasCycle = true;
        }

        if (visited[s]) {
            // 已经遍历过的节点不用再遍历
            return;
        }

        if (hasCycle) {
            // 如果已经找到了环，也不用再遍历了
            return;
        }
        // 前序代码位置
        // @visualize color *graph._v(s) #7ed67e
        visited[s] = true;
        // @visualize color *graph._v(s) #e77427
        onPath[s] = true;
        for (let t of graph.neighbors(s)) {
            // @visualize color *graph._e(s,t) #e77427
            traverse(graph, t);
            // @visualize color *graph._e(s,t) #unset
        }
        // 后序代码位置
        // @visualize color *graph._v(s) #7ed67e
        onPath[s] = false;
    }

    function buildGraph(numCourses, prerequisites) {
        // 图中共有 numCourses 个节点
        // @visualize skip
        let adjList = new Array(numCourses).fill(0).map(() => []);
        for (let edge of prerequisites) {
            let from = edge[1];
            let to = edge[0];
            // 修完课程 from 才能修课程 to
            // 在图中添加一条从 from 指向 to 的有向边
            adjList[from].push(to);
        }
        return Graph.createDirectedGraphFromAdjList(adjList);
    }
};

